  [],\n\t\"revision_timestamp\": \"2016-10-08T14:53:48.457391\",\n\t\"name\": \"medical-expenditure-panel-survey-meps-summary-data-tables\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Summary Data Tables Data collected through
  MEPS are used to generate tables with frequently used summary statistics. These
  tables are available here for both the Household Component and the Insurance Component.<br
  />nHousehold Component Summary Tables<br />nThe Household Component summary tables
  provide frequently used summary estimates at the national level on household medical
  utilization and expenditures: demographic characteristics, health conditions, health
  status, use of medical care services, charges and payments, access to care, satisfaction
  with care, health insurance coverage, income, and employment. Some of these tables
  can be customized online. State-level estimates of household medical utilization
  and expenditures are also provided for selected states. Insurance Component Summary
  Tables<br />nThe Insurance Component summary tables provide estimates at the national,
  state, and metro area levels on employer-based health insurance: number and types
  of insurance plans, premiums, benefits, contributions by employers and employees,
  and employer characteristics. Please note, in preparation for improvements in the
  data collection process, 2007 data for the Insurance Component was not collected.<br
  />nMEPS employer-based health insurance tables are produced in the year following
  data collection. Private-sector tables are posted in July; government and civilian
  tables are posted in November. National-level tables: Private sector estimates by
  firm size, industry group, census regions and other characteristics; public sector
  data by state and local government types, government size, and census division;
  civilian estimates that incorporate both the private and state and local government
  sectors; national totals for enrollees and cost of health insurance coverage for
  both the private and public sectors. State and metro area tables: State-level estimates
  for the private sector by firm size, industry groupings, ownership type, age of
  firm, employee characteristics, and average wage quartiles. Metropolitan area private
  sector estimates of premiums, employee contributions, enrollments, and take-up rates
  by firm size.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
